(22, 'Kita Harapkan Vaksinasi Booster Mencegah Penyebaran Varian Omicron', 'Presiden menyebutkan, selain di Kabupaten Bintan, program vaksinasi yang digelar pada Selasa juga berlangsung di sejumlah lokasi di Provinsi Kepulauan Riau, antara lain di Kabupaten Lingga, Kabupaten Karimun, Kota Batam, Kabupaten Natuna, Kabupaten Kepulauan Anambas, dan Kota Tanjungpinang. Pada kesempatan tersebut, Kepala Negara mengapresiasi tingginya persentase capaian vaksinasi di Kepulauan Riau. “Saya sangat senang, sangat bangga bahwa di Provinsi Kepulauan Riau ini vaksinasinya sudah sangat tinggi. Kami harapkan masyarakat semuanya terlindungi setelah melakukan vaksinasi,” ujar Presiden. Jokowi juga turut menyapa para peserta vaksinasi di Kabupaten Natuna dan Kabupaten Karimun melalui konferensi video. Presiden mengingatkan bahwa meskipun capaian vaksinasi sudah tinggi, percepatan vaksinasi harus terus dilakukan dengan melibatkan berbagai pihak. “Saya minta meskipun tadi angka persentasenya sudah tinggi, saya minta dibantu dari kodim dari polres untuk mempercepat proses vaksinasi,&quot; kata Jokowi. &quot;Biar semuanya terlindungi dari Covid-19. Saya sangat mengapresiasi persentase vaksinasinya yang sudah tinggi,” tambahnya. 4.878 kasus baru Covid-19 Hingga Selasa sore kemarin, pemerintah melaporkan penambahan 4.878 kasus baru Covid-19. Penambahan kasus baru itu tersebar di 29 provinsi. Dengan demikian, hingga Selasa total kasus Covid-19 di Tanah Air berjumlah 4.294.183. Menurut data Satuan Tugas Penanganan Covid-19, penambahan tertinggi ada di DKI Jakarta sebanyak 2.190 kasus. Kemudian, disusul Jawa Barat dengan 1.238 kasus dan Banten dengan 844 kasus. Sementara itu, secara kumulatif, kasus sembuh dari Covid-19 bertambah 869, sehingga totalnya menjadi 4.125.080 kasus. Kemudian, ada penambahan 20 kasus kematian akibat Covid-19. Dengan demikian, pasien Covid-19 meninggal dunia jadi 144.247 jiwa.', '61f0a8c8e19da.jpg', '2022-01-26'),
(27, 'Perjanjian Ekstradisi Diteken, Koruptor hingga Teroris Tak Lagi Bisa Bersembunyi di Singapura', 'Hal tersebut, sesuai dengan ketentuan maksimal kedaluwarsa sebagaimana diatur dalam Pasal 78 Kitab Undang-Undang Hukum Pidana Indonesia. “Selain masa rektroaktif, perjanjian ekstradisi ini juga menyepakati bahwa penentuan kewarganegaraan pelaku tindak pidana ditentukan pada saat tindak pidana dilakukan,&quot; kata Menteri Hukum dan HAM, Yasonna Laoly, dalam keterangan pers, Selasa. &quot;Hal ini untuk mencegah privilege yang mungkin timbul akibat pergantian kewarganegaraan dari pelaku tindak pidana guna menghindari proses hukum terhadap dirinya,” kata dia. 31 jenis tindak pidana Tindak pidana yang pelakunya dapat diekstradisi menurut perjanjian ekstradisi itu ada 31 jenis. Di antaranya tindak pidana korupsi, pencucian uang, suap, perbankan, narkotika, terorisme, dan pendanaan kegiatan yang terkait dengan terorisme. Yasonna menjelaskan, Indonesia dan Singapura sepakat untuk melakukan ekstradisi bagi setiap orang yang ditemukan berada di wilayah negara diminta dan dicari oleh negara peminta. Hal itu, dilakukan untuk proses penuntutan, persidangan atau pelaksanaan hukuman untuk tindak pidana yang dapat diekstradisi. “Perjanjian ekstradisi ini akan menciptakan efek gentar (deterrence) bagi pelaku tindak pidana di Indonesia dan Singapura,” ujar Menkumham.', '61f0ac68472b8.jpg', '2022-01-26'),
